import React from "react";
import { Link } from "react-router-dom";

const Links = [
  { to: "/", text: "Home" },
  { to: "/about", text: "About" },
];
const Navs = () => {
  return (
    <div>
      <ul>
        {Links.map((items) => (
          <li key={items.to}>
            <Link to={items.to}>{items.text}</Link>
          </li>
        ))}
        {/* <li>
          <Link to="/">This is home page</Link>
        </li> */}
      </ul>
    </div>
  );
};

export default Navs;
